Description.TranslatedText:
If SDTM.AE.AESEV='MILD' then CDASH.AE.AESEV=1,
else if SDTM.AE.AESEV='MODERATE' then CDASH.AE.AESEV=2,
else if SDTM.AE.AESEV='SEVERE' then CDASH.AE.AESEV=3,
else CDASH.AE.AESEV is null.

When SDTM.AE.AESER='N' then CDASH.AE.AESER='No',
else when SDTM.AE.AESER='Y' then do:
if SDTM.AE.AESDTH='Y' then CDASH.AE.AESER='1',
if SDTM.AE.AESLIFE='Y' then CDASH.AE.AESER='2',
if SDTM.AE.AESDIAB='Y' then CDASH.AE.AESER='3',
if SDTM.AE.AESHOSP='Y' then CDASH.AE.AESER='4',
if SDTM.AE.AESCONG='Y' then CDASH.AE.AESER='5',
if SDTM.AE.AESCAN='Y' then CDASH.AE.AESER='6',
if SDTM.AE.AESOD='Y' then CDASH.AE.AESER='7',
if SDTM.AE.AESMIE='Y' then CDASH.AE.AESER='8' (NOTE: AESMIE does not exist in SDTM.AE).

If SDTM.AE.AEREL='NONE' then CDASH.AE.AEREL=1,
else if SDTM.AE.AEREL='REMOTE' then CDASH.AE.AEREL=2,
else if SDTM.AE.AEREL='POSSIBLE' then CDASH.AE.AEREL=3,
else if SDTM.AE.AEREL='PROBABLE' then CDASH.AE.AEREL=4,
else CDASH.AE.AEREL is null.

If SDTM.DM.RACE='WHITE' then CDASH.DM.RACE='CA',
else if SDTM.DM.RACE='BLACK' then CDASH.DM.RACE='AF',
else if SDTM.DM.RACE='ASIAN' then CDASH.DM.RACE='EA',      
else if SDTM.DM.RACE='AMERICAN INDIAN OR ALASKA NATIVE' then CDASH.DM.RACE='O'.

If SDTM.DM.ETHNIC='HISPANIC' then concatenate ',HP' to value of mapped CDASH.DM.RACE

If SDTM.MH.MHSEV='MILD' then CDASH.MH.MHSEV=1,
else if SDTM.MH.MHSEV='MODERATE' then CDASH.MH.MHSEV=2,
else if SDTM.MH.MHSEV='SEVERE' then CDASH.MH.MHSEV=3,
else CDASH.MH.MHSEV is null.
